using System;

namespace xManik.Extensions
{
    public static class Utils
    {
        private const string Base64DefaultProfileImage = "";
        public static readonly byte[] ImageBytes = Convert.FromBase64String(Base64DefaultProfileImage);

        public static string ConvertByteToString(byte[] array)
        {
            var base64 = Convert.ToBase64String(array);
            return string.Format("data:image/jpeg;base64,{0}", base64);
        }
    }
}
